import axios from "axios";
import { useEffect, useState } from "react";
import Data from "./Data";

const DisplayData = ({library} : any) => {
    const [content, setContent] = useState([])

    useEffect(() => {
        axios
            .get(`http://127.0.0.1:5000/${library}/getData`)
            .then(response => response.data.data)
            .then(response => {
                setContent(content.concat(response))
                console.log("Reponse from data", response)
            })
            .catch(error => {
                console.log("So you thought", error)
            })
    }, [])

    return (
        <>
        {content.length > 0 ? content.map(element => 
            <Data key={element.id} data={element} />
        ) 
        : "No data to display"}
        </>
    )
}

export default DisplayData;
